import { useEffect,useState } from "react";
import { Link } from "react-router-dom";
import { getAllCats, deleteCatById } from "../services/internalApiService";
import { faker } from '@faker-js/faker';
// or, if using CommonJS
// const { faker } = require('@faker-js/faker');


const AllCats = (props) =>{
    const [cats, setCats] = useState([]);
    const randomUsername = faker.internet.userName() ; // Rowan Nikolaus
    const randomEmail = faker.internet.email(); // Kassandra.Haley@erich.biz
    
    useEffect(() => {
        getAllCats()
            .then(data => {
                console.log(data.results)
                setCats(data.results)
            })
            .catch(error =>[
                console.log(error)
            ])
    },[])

    const handleDelete = (idToDelete) => {
        deleteCatById(idToDelete)
            .then(data => {
                // There's no reason to stay on the page after the one item being viewed
                // has been deleted.
                console.log("delete and yeet")
                const filteredCats = cats.filter((cat) => {
                    return cat._id !== idToDelete
            })
            setCats(filteredCats)
            })
            .catch(err => {
                console.log(err)
            })
        }

    // console.log(cats)

    return (
        <div className="body mx-auto text-center">
        <h2>Dashboard</h2>

        {cats.map((cat) => {
            const { _id, name, type, description, } = cat;
            return (
                <div key={_id} className="shadow mb-4 rounded border p-4">
                    <h3> { name } </h3>
                    <p>{type}</p>
                    <p>{description}</p>
                    <p>{}</p>

                </div>
                ) } )
        }
        </div>
    )

}


export default AllCats;
